const Item = ({item}) => {
  return (
    <div className='work__card' key={item.id} >
        <div className="work__img" onClick={()=>{
            <a href='item.Doman'></a>
        }} >
        <img src={item.image} alt="" className='work__img1' style={{transform :'translateY(0%)'
    ,transition:'transform 10s ease-in-out 0s'}} />
        
        </div>

        <div className="work__title">
            <h3>{item.title}</h3>
        <p>{item.paragraf}</p>
        </div>
    </div>
  )
}

export default Item
